import React from "react";
function newRoom(){
    return (
        <div className="homePageWrapper">
          <div className="formWrapper">
            <h4>Paste Room Id</h4>
            <div className="inputGroups">
               <input className="inputBox" type ="text" placeholder="ROOM ID"></input>
               <input className="inputBox" type ="text" placeholder="USERNAME"></input>
               <button className="btn btn-join">Join</button>
               <span className="joinInfo">
                  If you don't have an invite create a &nb
               </span>
            </div>
          </div>
        </div>
    );
}
export default newRoom;
